elements.expression:
filters
| demodata
| markdown "Security Operations Team - " {date | formatDate "MMMM D, YYYY"} 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=24 align="left" color="#FFFFFF" weight="normal" underline=false italic=false}
| render

filters
| essql 
  query="SELECT  suricata.eve.alert.category alert, count(*) total
FROM \"filebeat-*\"
GROUP BY alert
ORDER BY total desc"
| markdown "Out of the **" {math "sum(total)" | formatNumber "0.[00a]"}
  "** alerts that occurred this past week, **" {getCell "alert"}
  "** was the most frequent with **" {getCell "total" | formatNumber "0.[0a]"}
  "** total alerts"
| render 
  css=".canvasRenderEl {
    background: #e6ebf2;
    border: 1px solid #ddd;
    border-left: 3px solid #00bfb3;
    color: #666;
    page-break-inside: avoid;
    font-family: monospace;
    font-size: 15px;
    line-height: 1.6;
    margin-bottom: 0.5em;
    max-width: 100%;
    overflow: auto;
    padding: 0.5em 0.5em;
    display: block;
    word-wrap: break-word;
}"

filters
| essql 
  query="SELECT host.hostname host, COUNT(*) total
FROM \"filebeat-*\"
WHERE event.severity=1
GROUP BY host
ORDER BY total DESC"
| markdown "Out of the **" {math "sum(total)" | formatNumber "0.[00a]"}
  "** SEV1's that occurred this past week, the top three hosts were **" {getCell "host" row=0} "** with **" {getCell "total" row=0 | formatNumber "0.[0a]"} "**, **" {getCell "host" row=1} "** with **" {getCell "total" row=1 | formatNumber "0.[0a]"} "**, **" {getCell "host" row=2} "** with **" {getCell "total" row=2 | formatNumber "0.[0a]"} "**"
| render 
  css=".canvasRenderEl {
    background: #e6ebf2;
    border: 1px solid #ddd;
    border-left: 3px solid #00bfb3;
    color: #666;
    page-break-inside: avoid;
    font-family: monospace;
    font-size: 15px;
    line-height: 1.6;
    margin-bottom: 0.5em;
    max-width: 100%;
    overflow: auto;
    padding: 0.5em 0.5em;
    display: block;
    word-wrap: break-word;
}"
